pragma solidity ^0.8.0;

contract Token{
    address public owner;
    string public name;
    string public symbol;
    uint256 public totalSupply_;
    uint8 public decimals;
    
    mapping (address => uint256) public balances;

    mapping (address => mapping(address => uint256)) allowed;

    
    constructor() public {
        owner = msg.sender;
        name = "Sezam";
        symbol = "SZM";
        decimals = 18;
        totalSupply_ = 1000;
        balances[owner] = totalSupply_;
    }

    function totalSupply() view public returns (uint256[1] memory a ){
        a[0] = totalSupply_;
        return a;
    }

    function balanceOf(address _owner) view public returns(uint256[1] memory a ){
      a[0] = balances[_owner];
        return a;
    }

    function transfer(address _to, uint256 _value) public returns (bool[1] memory a){
        require(balances[msg.sender] >= _value,"Insufficient funds");
            address _from = msg.sender;
            
            balances[_from] = balances[_from] - _value;
            balances[_to] = balances[_to] + _value;
            
            emit Transfer(_from, _to, _value);
            a[0] = true;
            return a;
    }

    function transferFrom(address _from, address _to,
        uint _value) public returns (bool[1] memory a){
            require(_value <= balances[_from],"Insufficient funds");
            require(_value <= allowed[_from][msg.sender],"Insufficient Confirmed Funds");
            
            balances[_from] = balances[_from] - _value;
            allowed[_from][msg.sender] = allowed[_from][msg.sender] - _value;
            balances[_to] = balances[_to] + _value;
            
            emit Transfer(_from, _to, _value);
            
            a[0] = true;
            return a;
    }

    function approve(address _spender, uint256 _value) public returns (bool[1] memory a){
        allowed[msg.sender][_spender] += _value;
        emit Approval(msg.sender, _spender, _value);
        a[0] = true;
        return a;
    }

    function allowance (address _owner, address _spender) public view returns(uint256[1] memory a){
        a[0] = allowed[_owner][_spender];
        return a;
    }

    event Approval(address indexed tokenOwner, address indexed spender,
     uint tokens);
    event Transfer(address indexed _from, address indexed _to,
     uint256 _value);

}

